import { css } from '@emotion/css';

export const styContainer = css`
  width: 100%;
  padding: 15px 10px 0px 15px;
`;

export const styTitle = css`
  font-size: 25px;
  font-weight: 600;
  margin-bottom: 5px;
`;

export const styContainerForm = css`
  margin-top: 20px;
`;
